.table-container >>> .el-table__header th:nth-last-child(2) {
    border-right: 1px solid #d3dae0 !important;
}
.table-container >>> .el-table__header th:nth-last-child(1) {
    border-right: none !important;
}
.el-tabs--top >>> .el-tabs__header {
    margin: 0 !important;
}
.el-dialog__wrapper >>> .el-form-item {
    display: inline-block !important;
    vertical-align: top;
    width: 47%;
    margin-bottom: 10px !important;
}
.el-dialog__wrapper >>> .dialog-custom {
    width: 80% !important;
    max-width: 800px;
}
.el-dialog__wrapper >>> .dialog-custom-executorRange {
    min-width: 450px;
}
